def my_func(input1: str, input2: str, input3: str) -> str:
    result = []
    length1 = len(input1)
    length2 = len(input2)

    index_map = {input1[i]: i for i in range(length1)}

    for char in input3:
        if char in index_map:
            index = index_map[char]
            if index < length2:
                result.append(input2[index])

    return ''.join(result)
```

