2. **Character Selection**: For each character in `input3`, we check if it exists in `input1`. If it does, we look up its index using `index_map`. Then, we use this index to pick a character from `input2`.

3. **Constructing Result**: We append the selected character from `input2` to a list `result`, which we finally convert into a string using `join`.

